import React, {useState, useMemo, useEffect} from 'react';
import Header from './Header';

function DisplayData ({excelData}) {

  /*let sums = Object.values(groupArray)
           .map(arr => arr.reduce((sums,{id, value}) => ({id, value: sums.value + +value}), {value:0}))
            console.log(sums)

  /*useEffect(() =>{
    console.log('abc')
   var data = excelData.filter((v,i,a)=>a.findIndex(t=>(t.username === v.username && t.problem_code === v.problem_code)===i))
   console.log(data);
   setComputedData(data);
  },[excelData]);*/

  const [sorting, setSorting] = useState({ field: "", order: "" });

  const headers = [
    { name: "SORTSEGS", field: "SORTSEGS", sortable: false },
    { name: "MINMAXSWAP", field: "MINMAXSWAP", sortable: false },
    { name: "TSP", field: "TSP", sortable: false },
    { name: "RNDCHULL", field: "RNDCHULL", sortable: false },
    { name: "ONECHANGE", field: "ONECHANGE", sortable: false },
    { name: "PERMLISCNSTR", field: 'PERMLISCNSTR', sortable: false},
    { name: "SCORE", field: "SCORE", sortable: true }
  ];

  let convertToLocalTime = (timeStr) =>{
    var date = new Date(timeStr);
    var strDate = date.getHours() +':'+ date.getMinutes() +':'+ date.getSeconds();
    return strDate;
  }

 /* let getTotalScore = (individualExcelData) => {
    let c=0;
     let filteredData =  excelData.filter(data => data.username === individualExcelData.username && data.result_code == 15);
     filteredData.map(res => {
        c += res.result_code;
     });

    return c;
  }*/

  let getProblemScore = (problems) => {
   // console.log(problems);
     var s1 = '?', s2 = '?', s3 = '?', s4 = '?', s5 = '?', s6='?';

     for (let index = 1; index < problems.length; index++) {
        switch(problems[index].problem_code)
        {
          case 'SORTSEGS' : s1 = problems[index].result_code;
                            break;
          case 'MINMAXSWAP' : s2 =problems[index].result_code;
                            break;
          case 'TSP': s3 = problems[index].result_code;
                            break;
          case 'RNDCHULL' : s4 = problems[index].result_code;
                            break;
          case 'ONECHANGE' : s5 = problems[index].result_code;
                            break;
          case 'PERMLISCNSTR' : s6 = problems[index].result_code;
                            break;
        }              
     }

    return(
      <>
      <td>{s1}</td>
      <td>{s2}</td>
      <td>{s3}</td>
      <td>{s4}</td>
      <td>{s5}</td>
      <td>{s6}</td>
      </>
    );
  }

  const sortedData = useMemo(() => {

    //Sorting comments
    if (sorting.field) {
        const reversed = sorting.order === "asc" ? 1 : -1;
        excelData = Object.entries(excelData).sort(
            (a, b) => (
              reversed * (a[1].total_score - b[1].total_score),
              console.log(a)
            )

        );
        /* console.log("data:"+ excelData);
        const data = [].concat(excelData)
        .sort((a, b) => a.total_score > b.total_score ? 1 : -1)*/

    }
    }, [excelData,sorting]);

  return( 
  <div className="DataWrapper">
     {excelData===null&&<>No file selected</>}
        {excelData!==null&&(
          <div>
            <table className='table1 '>
             <Header
                  headers={headers}
                  onSorting={(field, order) =>
                  setSorting({ field, order })
                   }
             />
              <thead>
                <tr>
                    <th>Username</th>
                    <th>Gender</th>
                    <th>Country Code</th>
                    <th>Country Name</th>
                    <th >Submission Date</th>
                    <td>15</td>
                    <td>15</td>
                    <td>15</td>
                    <td>15</td>
                    <td>15</td>
                    <td>15</td>
                    <th>75</th>     
                  </tr>                
               </thead>

           <tbody>
            {Object.entries(excelData).map((individualExcelData)=>(
                   <tr key={individualExcelData[1][0].username}>
                    <td >{individualExcelData[1][0].username}</td>
                    <td >{individualExcelData[1][0].gender}</td>
                    <td >{individualExcelData[1][0].country_code}</td>
                    <td >{individualExcelData[1][0].country_name}</td>
                    <td>{convertToLocalTime(individualExcelData[1][1].submission_date)}</td>
                    {getProblemScore(individualExcelData[1])}
                    <td>{individualExcelData[1].total_score}</td> 
                  </tr>   
                 ))

                }
             </tbody>   
           </table>  
        </div>       
        )}       
  </div>);
}


export default DisplayData;
